#define WIN32_LEAN_AND_MEAN
#include <Windows.h>
#include <stdio.h>
#define WIDTH 90
#define HEIGHT 50

unsigned char sprite[11][WIDTH*HEIGHT+1] = {
	"",
	"",
	"",
	"",
	"",
	"",
	"",
	"",
	"",
	"",
	""
};

char last_fill = ' ';
static HANDLE Handle;

void SetWindow(int Width, int Height) 
{ 
	COORD coord = {WIDTH,HEIGHT};
	SMALL_RECT Rect = {0,0,HEIGHT-1,WIDTH-1};
	CONSOLE_CURSOR_INFO CursoInfo;
	Rect.Top = 0;
	Rect.Left = 0;
	Rect.Bottom = HEIGHT -1;
	Rect.Right = WIDTH -1;
	SetConsoleScreenBufferSize(Handle, coord);
    SetConsoleWindowInfo(Handle, TRUE, &Rect);
	CursoInfo.dwSize = 1;
	CursoInfo.bVisible = 0;
	SetConsoleCursorInfo(Handle, &CursoInfo);
}

void drawSprite(unsigned char num){
	char out[] = "a";
	DWORD nWritten;
	COORD coord = {0,0};
	unsigned short i;
	SetConsoleCursorPosition(Handle, coord);
	for (i = 0; i < WIDTH*HEIGHT; i++){
		if (last_fill != sprite[num][i]){
			if (sprite[num][i] == 'f') SetConsoleTextAttribute(Handle,0);
			else {
				if (sprite[num][i] == 'k') SetConsoleTextAttribute(Handle,153);
				else if (sprite[num][i] == 's') SetConsoleTextAttribute(Handle,238);
			}
		}
		out[0] = last_fill;
		WriteConsole( Handle, out, 1, &nWritten, NULL);
		last_fill = sprite[num][i];
	}
}
int main(){
	unsigned char i = 1;
	Handle = GetStdHandle(STD_OUTPUT_HANDLE);
	SetWindow(90,50);
	while (1){
		drawSprite(i-1);
		i++;
		if (i == 12) i = 1;
		//Sleep(100);
	}
	return 0;
}